After placing the 14 terminals into the length‐1 CYK cells we get:

 1: {NT14}   2: {NT19}   3: {NT23}   4: {NT22}   5: {NT20,NT24}  
 6: {NT7,NT17}   7: {NT8,NT11}   8: {NT15}   9: {NT15}  10: {NT15}  
11: {NT23}  12: {NT24}   13: {NT11}   14: {NT12,NT25}

The only way to reach the start symbol S on the full span [1..14] is via the rule

  S → NT14  NT9

and indeed cell [1,1] contains NT14, and one finds by the CYK bottom‐up filling that the span [2..14] can be built as NT9.  Hence the entire string is generated.  

Yes
